import Box from '@material-ui/core/Box';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Typography from '@material-ui/core/Typography';
import React from 'react';

const useStyles = makeStyles({
    table: {
      minWidth: 650,
    },
  });

const activities = [
    { time: '9:00am', activity: 'Breakfast' },
    { time: '1:00pm', activity: 'Meet at park' },
    { time: '7:00pm', activity: 'Movie night' }
];

export default function DayContainer() {
    const classes = useStyles();
    return (
        <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="simple table">
                <TableHead>_DATE_</TableHead>
                <TableBody>
                    {activities.map(each => (
                        <TableRow key={each.name}>
                            <TableCell align="right">{each.time}</TableCell>
                            <TableCell align="right">{each.activity}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>

        // <Box border={1} color='black' width='80%'>
